import React from "react";
import ReactDOM from "react-dom";
import "./App.css";
import BigDisplay from "./App";
import Block from "./block.js";

export default class NetLayout extends React.Component {
  render() {
    return <BigDisplay colour="2" />;
  }
}

ReactDOM.render(<BigDisplay colour="2" />, document.getElementById("root"));
